import React from 'react';
import UploadResume from './components/UploadResume';
import JobList from './components/JobList';
export default function App() {
  return (
    <div className="p-4">
      <h1 className="text-xl">Resume & Job Matcher</h1>
      <UploadResume />
      <JobList />
    </div>
  );
}
